import './ExpenseItem.css';

function ExpenseItem() {
  return (
    <div className={expense-item}>
      <div>Date</div>
      <div>
        <h2>Car Insurance</h2>
        <div>Amount</div>
      </div>
    </div>
  );
}

export default ExpenseItem; //html 요소처럼 쓸 수 있음
